import React from "react";
import {renderRoutes} from 'react-router-config';

function Home(props){
    const { route } = props;
    console.log(props)
    return(
        <div>
            <div>Home</div>
            {renderRoutes(route.routes)}
        </div>
    )
}

export default React.memo(Home);
